class App extends React.Component {
  constructor() {
    super();
    this.state = {
      number: 1,
    };
    add = () => {
      this.setState({
        number: 2,
      });
    };
  }

  render() {
    return (
      <div>
        <button onClick={add}>yo</button>
        <h1>{this.state.number}</h1>
        <SearchBox />
        <Cardlist robot={robots} />;
      </div>
    );
  }
}

export default App;
